import './App.scss';
import { Routes, Route} from "react-router-dom";
import Layout from "./components/Layout";

function App() {
  return (
   <>
     <Routes>
       <Route path="/" component={<Layout/>}/>
     </Routes>
   </>
  );
}

export default App;
